import React from 'react'

class NameCard extends React.Component {
  render(){
    const {name, number, sex, tags} = this.props;
    return(
      <div>
        <h2>Name:{name}</h2>
        <ul>
          <li>Phone:{number}</li>
          <li>Sex:{sex}</li>
        </ul>
        <p>
          { tags.map((item, index) => (
            <span key={index}>{item}</span>
          ))}
        </p>
      </div>
    )
  }
}

export  default NameCard
